import React, { Component } from 'react';

export default class CreateExercise extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: '',
      description: '',
      duration: 0,
      date: new Date(),
      users: []
    }
  }

  onChangeUsername(e) {
    this.state.username({
      username: e.target.value
    })
  }

  onChangeDescription(e) {
    this.state.username({
      description: e.target.value
    })
  }

  onChangeUsername(e) {
    this.state.username({
      username: e.target.value
    })
  }
  onChangeUsername(e) {
    this.state.username({
      username: e.target.value
    })
  }
